import React,{Component} from 'react';
import Signup from './Signup.js';
import SignIn from './SignIn.js';
import { Dashboard ,Navbar} from './Dashboard.js';
import './App.css';
import { BrowserRouter as Router, Route,Switch} from 'react-router-dom';

class App extends Component {
render(){
  return (
    <Router>
      <div className="App">
        <Navbar/>
        <div>
          <Switch>
            <Route path="/">
              <h2>Dashboard<Dashboard /></h2>
            </Route>
          </Switch>
        </div>
        <div >
         <Switch>
           <Route path="/Signup">
             <h2>Sign-Up<Signup/></h2>
           </Route>
         </Switch>
        </div>
        <div >
          <Switch>
            <Route path="/SignIn">
             <h2>Sign-In<SignIn/></h2>
            </Route>
          </Switch>
        </div>

      </div>
    </Router>
  );
}}

export default App;
